bioghist.p:
De Senaat behartigde de belangen het onderwijs en onderzoek aangaande. Tot de taak van de Senaat behoorde o.a.:


jaarlijkse vaststelling van het studieprogramma;

vaststelling van het reglement v.d. Senaat;

vaststelling van het promotiereglement;

toekenning van het doctoraat en ere-doctoraat.

