Het Koninklijk Instituut van Ingenieurs te Den Haag, opgericht 31 augustus 1847 gaf/geeft jaarboeken uit waarin worden vermeld:


alle studenten welke lid zijn/waren van het KIVI;

alle afgestudeerde ingenieurs (Delft, Eindhoven, Twente).
